import React from 'react'
import ReactDOM from 'react-dom'

const divEl = (
  <div>
    <button>Hello world</button>
  </div>
);
console.log(divEl);
const rootElement = document.querySelector('#root');
ReactDOM.render(
<input 
  type="number"
  value={2+2}
  onChange={
    (event) => console.log(event.target.value)
  }>

</input>, rootElement);
